import React from "react"
import myCV from "../../assets/images/Moaz-Gad.pdf"
function DownloadBtn() {
  const handleDownload = () => {
    const url = { myCV }
    window.open(url, "_blank")
  }

  return (
    <a className="download-btn" href={myCV} download>
      Download CV
    </a>
  )
}

export default DownloadBtn
